DROP DATABASE IF EXISTS Paises2025;
CREATE DATABASE Paises2025;
USE Paises2025;
DROP TABLE IF EXISTS `PaisesContinenteCodigo`;
CREATE TABLE `PaisesContinenteCodigo` (
  `ID` INTEGER,
  `nome_pais` TEXT,
  `continente` TEXT,
  `codigo_pais` TEXT
);


DROP TABLE IF EXISTS `DadosPaises2`;
CREATE TABLE `DadosPaises2` (
  `codigo_pais` TEXT,
  `capital` TEXT,
  `populacao` REAL,
  `idh` REAL,
  `pib_usd` REAL,
  `pib_per_capita_usd` REAL
);

